import React from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { fadeOut } from './transitions';
import { useMenuStates } from './useMenuStates';
import styled from 'rn-css';
import styled2 from 'styled-components';
import { colors } from '@mevron/cross-core/components/typo';

const LogoContainer = styled2.div`
    background-color: ${colors.backgroundColor};
    padding: 20px;
    position: relative;
    justify-content: center;
    align-items: center;
    display: flex;
`;

const Logo = styled.Image`
    width: 89px;
    height: 30px;
    z-index: 2;
`;
const LogoSmall = styled.Image`
    height: 20px;
    width: 20px;
    z-index: 2;
`;

export default function LogoTrans() {
    const menuStates = useMenuStates().get();
    return (
        <LogoContainer>
            <AnimatePresence>
                {!menuStates ? (
                    <motion.div {...fadeOut}>
                        <LogoSmall source={require('@mevron/cross-core/assets/jcmoj.png')} />
                    </motion.div>
                ) : null}
                {menuStates ? (
                    <motion.div {...fadeOut}>
                        <Logo source={require('@mevron/cross-core/assets/jc-mini.png')} />
                    </motion.div>
                ) : null}
            </AnimatePresence>
        </LogoContainer>
    );
}
